import { StyleSheet } from "react-native";
import theme from "./theme";

const todayWorkoutStyles = StyleSheet.create({
    addExerciseButton: {
        flexDirection: "row",
        backgroundColor: theme.primary1,
        marginTop: 30,
        borderRadius: 5,
        paddingVertical: 5,
        paddingHorizontal: 15,
        alignItems: "center"
    },
    addExerciseButtonIcon: {
        fontSize: 30
    },
    addExerciseButtonText: {
        color: theme.fontColor1,
        marginLeft: 10,
        fontSize: 16
    },
    dateNavigation: {
        flex: 1,
        justifyContent: "space-between",
        color: theme.fontColor1,
        flexDirection: "row",
        alignItems: "center"
    },
    dateNavigationText: {
        color: theme.fontColor1,
        fontSize: 16
    }
});

const exerciseStyles = StyleSheet.create({
    title: {
        textAlign: "center",
        fontSize: 20,
        color: theme.primary1,
        marginBottom: 10
    },
    numberInput: {
        flexDirection: "row",
        justifyContent: "space-around",
        alignItems: "center"
    },
});

export {
    todayWorkoutStyles,
    exerciseStyles
};
